import React, { useState } from "react";
import { useSocket } from "./socket/socket.js";

function App() {
  const [username, setUsername] = useState("");
  const [message, setMessage] = useState("");
  const {
    isConnected,
    messages,
    users,
    typingUsers,
    connect,
    sendMessage,
    setTyping
  } = useSocket();

  const handleJoin = (e) => {
    e.preventDefault();
    if (username.trim()) {
      connect(username);
    }
  };

  const handleSendMessage = (e) => {
    e.preventDefault();
    if (message.trim() && isConnected) {
      sendMessage(message);
      setMessage("");
      setTyping(false);
    }
  };

  if (!isConnected) {
    return (
      <div style={{ padding: "20px" }}>
        <h1>ðŸ’¬ Chat Application</h1>
        <form onSubmit={handleJoin}>
          <input
            type="text"
            placeholder="Enter your username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            style={{ padding: "8px", marginRight: "10px" }}
          />
          <button type="submit" style={{ padding: "8px 16px" }}>
            Join Chat
          </button>
        </form>
      </div>
    );
  }

  return (
    <div style={{ padding: "20px" }}>
      <h1>ðŸ’¬ Chat Room</h1>
      <div style={{ marginBottom: "20px" }}>
        <strong>Status:</strong> âœ… Connected as {username}
      </div>

      <div style={{ display: "flex", gap: "20px" }}>
        {/* Messages Section */}
        <div style={{ flex: 2 }}>
          <h3>Messages</h3>
          <div style={{ border: "1px solid #ccc", height: "300px", overflowY: "scroll", padding: "10px" }}>
            {messages.map((msg, index) => (
              <div key={index} style={{ marginBottom: "10px" }}>
                {msg.system ? (
                  <em style={{ color: "#666" }}>{msg.message}</em>
                ) : (
                  <div>
                    <strong>{msg.username}:</strong> {msg.message}
                  </div>
                )}
              </div>
            ))}
          </div>

          <form onSubmit={handleSendMessage} style={{ marginTop: "10px" }}>
            <input
              type="text"
              placeholder="Type a message..."
              value={message}
              onChange={(e) => {
                setMessage(e.target.value);
                setTyping(true);
              }}
              style={{ padding: "8px", width: "70%", marginRight: "10px" }}
            />
            <button type="submit" style={{ padding: "8px 16px" }}>
              Send
            </button>
          </form>

          {typingUsers.length > 0 && (
            <div style={{ color: "#666", fontStyle: "italic", marginTop: "5px" }}>
              {typingUsers.join(", ")} {typingUsers.length === 1 ? "is" : "are"} typing...
            </div>
          )}
        </div>

        {/* Online Users Section */}
        <div style={{ flex: 1 }}>
          <h3>Online Users ({users.length})</h3>
          <div style={{ border: "1px solid #ccc", padding: "10px" }}>
            {users.map((user, index) => (
              <div key={index}>ðŸ‘¤ {user.username}</div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
